import { Navbar, Nav, Form, Button } from 'react-bootstrap';
import { withRouter } from 'react-router-dom';

import '../../App.css';

function Navigation() {
  return (
    <div className="Navigation">
      <nav className="navbar navbar-expand-lg">
          <div className="container-fluid">
              <a className="navbar-brand logo" href="#home" title="Fisher Mary Anike">Fisher Mary</a>
                  <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                      <span className="navbar-toggler-icon"></span>
                   </button>
                 <div className="collapse navbar-collapse standard navbar-right" id="navbarNav">
                    <ul className="navbar-nav menu">
                         <li className="nav-item">
                           <a className="nav-link" href="/About">About</a>
                         </li>
                          <li className="nav-item">
                           <a className="nav-link" href="mailto:fishermary@gmail.com">Contact</a>
                         </li>
                     </ul>
                  </div>
             </div>
         </nav>
    </div>
  );
}

export default Navigation;
